import React from "react";
import {Link} from "react-router-dom";
import NavigationSidebar from "./NavigationSidebar/index"
const Tuiter = () => {
    return(
        <>
            <h1>Tuiter</h1>
            <NavigationSidebar/>
            <Link to="/hello">
                Hello
            </Link> |
            <Link to="/labs">
                Labs
            </Link>
        </>
    )
};

export default Tuiter;
